	"com/amista/employeeapplication/view/EmpPersonalView.view.xml":'<mvc:View\n    controllerName="com.amista.employeeapplication.controller.EmpPersonalView"\n    xmlns:m="sap.m"\n    xmlns:mvc="sap.ui.core.mvc"\n    xmlns:core="sap.ui.core"\n    xmlns="sap.uxap"\n    xmlns:layout="sap.ui.layout"\n    xmlns:forms="sap.ui.layout.form"\n    xmlns:viz="sap.viz.ui5.controls" \n    xmlns:viz.feeds="sap.viz.ui5.controls.common.feeds"\n    xmlns:viz.data="sap.viz.ui5.data" \n    displayBlock="true"\n><m:Page showNavButton="true" navButtonPress="onPressBackButton" title="{i18n>title2}"><ObjectPageLayout\n        id="ObjectPageLayout"\n        showTitleInHeaderContent="true"\n        showEditHeaderButton="true"\n        editHeaderButtonPress="handleEditBtnPress"\n        upperCaseAnchorBar="false"\n    ><headerTitle><ObjectPageDynamicHeaderTitle><expandedHeading><m:HBox><m:Title\n                            text="{FIRSTNAME} {LASTNAME}"\n                            wrapping="true"\n                        /><m:ObjectMarker\n                            type="Favorite"\n                            class="sapUiTinyMarginBegin"\n                        /></m:HBox></expandedHeading><snappedHeading><m:FlexBox\n                        fitContainer="true"\n                        alignItems="Center"\n                    ><m:Image src="./formal.png" width="60px" height="60px" class="image" /><m:Title\n                            text="{FIRSTNAME} {LASTNAME}"\n                            wrapping="true"\n                        /></m:FlexBox></snappedHeading><expandedContent><m:Text text="{JOBTITLE}" /></expandedContent><snappedContent><m:Text text="{JOBTITLE}" /></snappedContent><snappedTitleOnMobile><m:Title text="{JOBTITLE}" /></snappedTitleOnMobile><actions><m:OverflowToolbarButton\n                        icon="sap-icon://edit"\n                        text="edit header"\n                        type="Emphasized"\n                        tooltip="edit"\n                    ><m:layoutData><m:OverflowToolbarLayoutData\n                                priority="NeverOverflow"\n                            /></m:layoutData></m:OverflowToolbarButton><m:OverflowToolbarButton\n                        icon="sap-icon://pull-down"\n                        text="show section"\n                        type="Emphasized"\n                        tooltip="pull-down"\n                    /><m:OverflowToolbarButton\n                        icon="sap-icon://show"\n                        text="show state"\n                        tooltip="show"\n                    /><m:Button\n                        text="Toggle Footer"\n                        press="toggleFooter"\n                    /></actions></ObjectPageDynamicHeaderTitle></headerTitle><headerContent><m:FlexBox wrap="Wrap"><m:Image src="./formal.png" width="60px" height="60px" class="image" /><layout:VerticalLayout class="sapUiSmallMarginBeginEnd"><m:Link text="{PRIMARYPHONENUMBER}" /><m:Link text="{EMAIL}" /></layout:VerticalLayout><layout:HorizontalLayout class="sapUiSmallMarginBeginEnd"><m:Image\n                        src="./test-resources/sap/uxap/images/linkedin.png"\n                    /><m:Image\n                        src="./test-resources/sap/uxap/images/Twitter.png"\n                        class="sapUiSmallMarginBegin"\n                    /></layout:HorizontalLayout><layout:VerticalLayout class="sapUiSmallMarginBeginEnd"><m:Label\n                        text="Hello! I am {FIRSTNAME} and I use some extraordinary tools to do my work as a {JOBTITLE}"\n                    /><m:VBox><m:Label text="Achieved goals" width="200px" design="Bold"/><m:ProgressIndicator\n                            percentValue="70"\n                            displayValue="70%"\n                        /></m:VBox></layout:VerticalLayout><layout:VerticalLayout class="sapUiSmallMarginBeginEnd"><m:Label\n                        text="{STREET}, {CITY}, {STATE} - {POSTALCODE}, {COUNTRY}"\n                    /></layout:VerticalLayout></m:FlexBox></headerContent><sections><core:Fragment fragmentName = "com.amista.employeeapplication.Fragments.goalsPlan" type="XML" /><core:Fragment fragmentName = "com.amista.employeeapplication.Fragments.personal" type="XML" /><core:Fragment fragmentName = "com.amista.employeeapplication.Fragments.employment" type="XML" /></sections></ObjectPageLayout></m:Page></mvc:View>\n',
	"com/amista/employeeapplication/view/EmployeePortalView.view.xml":'<mvc:View\n    controllerName="com.amista.employeeapplication.controller.EmployeePortalView"\n    xmlns:mvc="sap.ui.core.mvc"\n    displayBlock="true"\n    xmlns="sap.m"\n><Page\n        id="page"\n        title="{i18n>title}"\n        showNavButton="true"\n        navButtonPress="onPressBackButton"\n    ><content /><List\n            headerText="Employees Details"\n            items="{/EMPLOYEE}"\n            growingScrollToLoad="true"\n        ><ObjectListItem\n                title="{= ${FIRSTNAME} + \' \' + ${LASTNAME} }"\n                press="onListItemPress"\n                type="Navigation"\n                number="{= ${COUNTRYCODE} +\' \'+ ${PRIMARYPHONENUMBER} }"\n            ><firstStatus><ObjectStatus\n                        text="{EMPID}"\n                        icon="sap-icon://sys-enter-2"\n                        state="{path: \'EMPID\', formatter: \'.FormatID.funID\'}"\n                    /></firstStatus><ObjectAttribute text="{EMAIL}" /><ObjectAttribute\n                    text="{= ${CITY} +\', \' + ${STATE} +\', \'+ ${COUNTRY}}"\n                /></ObjectListItem></List></Page></mvc:View>\n'
